#include<stdio.h>
void swap(int *x, int *y)
{
    int temp = *x;
    *x = *y;
    *y = temp;
}

void Bubble(int A[], int n)
{
    int i,j;
    int flag =0;
    for(i=0; i<n-1;i++)
    {
        flag =0;
        for(j=0;j<n-i-1;j++)
        {
            if(A[j] > A[j+1])
                swap(&A[j], &A[j+1]);
               flag =1;
        }
        if (flag==0) return;
    }
}
